import React from 'react';
import { Link } from 'react-router-dom';
import { MyRoutes, Selection } from './Router';
import marvel from '../img/shield.png';
import pixar from '../img/lamp.png';

const Home = () => {
  return (

      <div className="homeContainer">
        <section className="selection">
            <img className="logoHome" src={pixar}></img>
            <h2>Pixar</h2>
            <Link className="links" to={`${MyRoutes.SELECTION}/${Selection.PIXAR}`}>Show more !</Link>
        </section>
        <section className="selection">
            <img className="logoHome" src={marvel}></img>
            <h2>Marvel</h2>
            <Link className="links" to={`${MyRoutes.SELECTION}/${Selection.MARVEL}`}>Show more !</Link>
        </section>

      </div>

  )
}

export default Home;
